import React from 'react';
import "./Board.css";

const post = {
    'id':1,
    'title':"첫게시글",
    'content':"내용1",
    'writer' : "김태훈",
    'date' : Date.now
  }
  
function Board() {
    return (
        <div>
            <PostList />
        </div>
    )
}



function PostList() {
    return (
        <div>
            <PostProfile id={post.id} title={post.title} content={post.content} writer={post.writer} date={post.date} />
        </div>
    )
}

function PostProfile(props) {
    return(
        <div>
            <h2>{props.id}</h2>
            <h2>{props.title}</h2>
            <h2>{props.content}</h2>
            <h2>{props.writer}</h2>
            <h2>{props.date}</h2>
        </div>
    )
}



export default Board;
